import HTML from '../assets/icons8-html-5-144.png';
import CSS from '../assets/icons8-css3-144.png';
import PSQL from '../assets/icons8-postgresql-144.png';





function Skills() {
    return (
        <div className='skills'>
            {/* container */}
            <div>
                <div>
                <div>Skills</div>
                <p>Skills Which i Learned</p>
                </div>

                <div>
                    <img className='w-20 mx-auto' src={C} alt="C icon"></img>
                    <p>C</p>
                </div>
            <div>
            </div>
            </div>
        </div>
    );
};

export default Skills;
